class DataProcessingService:
    """Handles partial or incomplete data."""

    def handle_partial_zip(self, zip_code: str) -> str:
        """Handle ZIP codes missing last 4 digits."""
        if len(zip_code) == 5 and zip_code.isdigit():
            return zip_code + "-0000"
        return zip_code

